BEGIN TRANSACTION;
CREATE TABLE "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE "battles_battlemodel" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "created_at" datetime NOT NULL, "status" varchar(64) NOT NULL, "start_datetime" datetime NOT NULL, "proof" text NOT NULL, "team_first_id" bigint NULL REFERENCES "teams_teammodel" ("id") DEFERRABLE INITIALLY DEFERRED, "team_second_id" bigint NULL REFERENCES "teams_teammodel" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "battles_battlemodel_judges" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "battlemodel_id" bigint NOT NULL REFERENCES "battles_battlemodel" ("id") DEFERRABLE INITIALLY DEFERRED, "usermodel_id" bigint NOT NULL REFERENCES "users_usermodel" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "users_usermodel" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE "news_generalnewsmodel" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "title" varchar(127) NOT NULL, "content" text NOT NULL, "created_at" datetime NOT NULL, "author_id" bigint NULL REFERENCES "users_usermodel" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "teams_invitationtoteammodel" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "created_at" datetime NOT NULL, "status" varchar(32) NOT NULL, "invited_user_id" bigint NOT NULL REFERENCES "users_usermodel" ("id") DEFERRABLE INITIALLY DEFERRED, "team_id" bigint NOT NULL REFERENCES "teams_teammodel" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "teams_member" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "created_at" datetime NOT NULL, "role_name" varchar(255) NOT NULL, "user_id" bigint NOT NULL REFERENCES "users_usermodel" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "teams_teammodel" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(255) NOT NULL, "created_at" datetime NOT NULL, "leader_id" bigint NOT NULL REFERENCES "users_usermodel" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "teams_teammodel_members" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "teammodel_id" bigint NOT NULL REFERENCES "teams_teammodel" ("id") DEFERRABLE INITIALLY DEFERRED, "member_id" bigint NOT NULL REFERENCES "teams_member" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "tournaments_eventfortimetable" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(255) NOT NULL, "description" text NOT NULL, "start_datetime" datetime NOT NULL, "end_datetime" datetime NOT NULL, "tournament_id" bigint NOT NULL REFERENCES "tournaments_tournamentmodel" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "tournaments_requestteamfortournamentmodel" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "created_at" datetime NOT NULL, "status" varchar(32) NOT NULL, "team_id" bigint NOT NULL REFERENCES "teams_teammodel" ("id") DEFERRABLE INITIALLY DEFERRED, "tournament_id" bigint NOT NULL REFERENCES "tournaments_tournamentmodel" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "tournaments_tournamentmodel" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "title" varchar(255) NOT NULL, "description" text NOT NULL, "rules" text NOT NULL, "count_of_members_in_team" smallint unsigned NOT NULL CHECK ("count_of_members_in_team" >= 0), "count_of_teams" smallint unsigned NOT NULL CHECK ("count_of_teams" >= 0), "created_at" datetime NOT NULL, "start_datetime" datetime NOT NULL, "end_datetime" datetime NOT NULL, "owner_id" bigint NULL REFERENCES "users_usermodel" ("id") DEFERRABLE INITIALLY DEFERRED, "is_closed_for_requests" bool NOT NULL);
CREATE TABLE "tournaments_tournamentmodel_judges" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "tournamentmodel_id" bigint NOT NULL REFERENCES "tournaments_tournamentmodel" ("id") DEFERRABLE INITIALLY DEFERRED, "usermodel_id" bigint NOT NULL REFERENCES "users_usermodel" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "tournaments_tournamentnews" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "title" varchar(127) NOT NULL, "content" text NOT NULL, "created_at" datetime NOT NULL, "author_id" bigint NULL REFERENCES "users_usermodel" ("id") DEFERRABLE INITIALLY DEFERRED, "tournament_id" bigint NOT NULL REFERENCES "tournaments_tournamentmodel" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "users_usermodel" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "bio" text NOT NULL, "email" varchar(254) NOT NULL UNIQUE, "is_pulbic_profile" bool NOT NULL);
CREATE TABLE "users_usermodel_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "usermodel_id" bigint NOT NULL REFERENCES "users_usermodel" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE "users_usermodel_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "usermodel_id" bigint NOT NULL REFERENCES "users_usermodel" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
